INSERT INTO `osc_goods_description` VALUES ('17', '17', '鑫瑶果神源于纯天然野生山葡萄头道原浆', '&lt;p&gt;鑫瑶果神源于纯天然野生山葡萄头道原浆，由国家级果露酒调酒师调制出极致口感更充分提取葡萄中富含的维生素C、花青素，清爽利口之余，更有调理睡眠、通润肠道、美白肌肤、清热祛湿等特性每天一杯鑫瑶果神，让健康生活更有&amp;ldquo;鑫&amp;rdquo;意！750ml大瓶装哦！&lt;/p&gt;\r\n\r\n&lt;p&gt;相传布努瑶始母密洛陀在巡游桂西北十万瑶山时，发现当地湿热难耐、瘴气终年不散，不少瑶族子民极易在盛夏时中暑昏倒、或在在寒冬中伤风感冒，便派儿子布卡寻找良药。布卡在山中苦寻三月，尝遍百草，终在白蛟盘踞之处寻得仙草，解了子民中暑、伤风之患。从此，当地群众常饮此茶，可清热解毒、祛风解表、益胃生津，又因其茶香清冽、口感尚佳，故而得名&amp;mdash;&amp;mdash;&amp;ldquo;茶儿香&amp;rdquo;。&lt;/p&gt;\r\n', '', '');
