INSERT INTO `osc_goods_description` VALUES ('30', '37', '韩国超微小气泡毛孔深层清洁 原价398 团购只需158', '&lt;p&gt;韩国超微小气泡毛孔深层清洁管理 &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;1份 &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;398元&lt;/p&gt;\r\n\r\n&lt;p&gt;服务流程：&lt;/p&gt;\r\n\r\n&lt;p&gt;1、3D皮肤检测及专业复制分析 1份 298元&lt;/p&gt;\r\n\r\n&lt;p&gt;2、热能面部放松 &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;1份 38元&lt;/p&gt;\r\n\r\n&lt;p&gt;3、面部卸妆 &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;1份 38元&lt;/p&gt;\r\n\r\n&lt;p&gt;4、韩式深层洁面 &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;1份68元&lt;/p&gt;\r\n\r\n&lt;p&gt;5、高周波部提升 &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;1份 298元&lt;/p&gt;\r\n\r\n&lt;p&gt;6、超微小气泡毛孔深层清洁 &amp;nbsp;&amp;nbsp;&amp;nbsp;1份 398元&lt;/p&gt;\r\n\r\n&lt;p&gt;7、韩国专业量肤配制营养软膜 &amp;nbsp;1份 198元&lt;/p&gt;\r\n\r\n&lt;p&gt;8、PDT光谱仪细胞再生修护 &amp;nbsp;&amp;nbsp;&amp;nbsp;1份 188元&lt;/p&gt;\r\n\r\n&lt;p&gt;9、物理防晒+隔离 &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;1份68元&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;最高价值 &amp;nbsp;&amp;nbsp;&amp;nbsp;1592元&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;团购价 &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;158 元&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;作用：通过物理负压的原理，将超微气泡与三款专业溶液相结合，通过特殊设计的小螺旋探头直接作用与皮肤，将超微气泡渗透毛孔0.8毫米，促进老化角质剥离，清除肌肤，让毛孔内的油污，白头，残留彩妆，老化角质以及毛囊虫。&lt;/p&gt;\r\n\r\n&lt;p&gt;建议：每周进行毛孔深层清洁1次，可以使肌肤由内而外的洁净，做完之后皮肤会变得非常干净通透明亮。&lt;/p&gt;\r\n', '', '');
